use super::*;

fn test_uastc_mode(mode: usize) {
    let test_blocks = TEST_DATA_UASTC_RGBA[mode];
    for (uastc, rgba) in test_blocks.iter() {
        let decoded_rgba = decode_block_to_rgba(*uastc).unwrap();
        let mut decoded_rgba_u32 = [0u32; 16];
        for i in 0..16 {
            decoded_rgba_u32[i] = decoded_rgba[i].to_rgba_u32();
        }
        assert_eq!(
            &decoded_rgba_u32, rgba,
            "\n{:02X?}\n{:08X?}\n{:08X?}",
            uastc, &decoded_rgba_u32, rgba
        );
    }
}

#[test]
fn test_blocks_uastc_to_rgba() {
    // CEM 8 - RGB Direct
    test_uastc_mode(0);
    test_uastc_mode(1);
    test_uastc_mode(2);
    test_uastc_mode(3);
    test_uastc_mode(4);
    test_uastc_mode(5);
    test_uastc_mode(6);
    test_uastc_mode(7);

    // Void-Extent
    test_uastc_mode(8);

    // CEM 12 - RGBA Direct
    test_uastc_mode(9);
    test_uastc_mode(10);
    test_uastc_mode(11);
    test_uastc_mode(12);
    test_uastc_mode(13);
    test_uastc_mode(14);

    // CEM 4 - LA Direct
    test_uastc_mode(15);
    test_uastc_mode(16);
    test_uastc_mode(17);

    // CEM 8 - RGB Direct
    test_uastc_mode(18);
}

